s($,"ayY","akz",()=>A.c([A.f5("Most classrooms aren\u2019t built for children who learn ahead of pace. These kids often finish early, get bored, and start tuning out. Some are pushed to skip grades, but that brings social and emotional risks. A mismatch between academic ability and classroom pace creates frustration \u2014 for both the child and the teacher.\n\nKuching Selective was created to fix that.","Why We Exist"),A.f5("Gifted kids can fall through the cracks \u2014 not because they\u2019re fine, but because their needs are easy to miss. When they\u2019re bored, misunderstood, or unchallenged, things slip fast.\n\nKuching Selective exists so they don\u2019t have to keep waiting. So they can learn at their level, be seen for who they are, and find their people.","Why It Matters"),A.f5("We focus on depth, not pressure \u2014 and curiosity, not competition.\n\nStudents are expected to come ready to learn. The pace is fast, but the environment is calm, respectful, and grounded. No grades, no hot-housing, no toxic comparison \u2014 just real learning, with real support. Every child here deserves to feel both safe and challenged.","Our Learning Culture")],A.ab("x<jQ>")))
s($,"az1","akB",()=>A.c([A.f5("We group children by what they can do \u2014 not how old they are. That means students will learn beside others who think at a similar level and pace. Instead of waiting for classmates to catch up, they move forward when they\u2019re ready. The work is designed to be challenging, engaging, and tailored to ability \u2014 not age.","Our Approach"),A.f5("Gifted learners don\u2019t just need harder work \u2014 they need smarter teaching. We plan to assess what each child already knows before they begin, so time isn\u2019t wasted.\n\nPacing will be flexible. If a student masters something quickly, they can move forward. If they want to go deeper, they can. Real-world problems and collaborative tasks will be integrated so learning sticks.","How We Teach"),A.f5("Our curriculum will be designed around ideas, not just topics. Students might solve real problems, debate tough ethical choices, or create something new that draws from multiple disciplines.\n\nCollaborative challenges will teach reasoning, resilience, and teamwork. Instead of keeping subjects in silos, we\u2019ll often start with a big question and let students draw on whatever tools they need \u2014 maths, science, writing, coding. The goal isn\u2019t to memorise. It\u2019s to think originally and deeply.","Designing for Thinking"),A.f5("We are preparing core academic programs based on UK and Malaysian curricula. These will be supported by enrichment pathways in STEM, literature, and the arts.\n\nStudents may be placed across different year levels by subject \u2014 for example, Year 3 English and Year 5 Maths \u2014 based on individual readiness.","What We Offer"),A.f5("Our programs are designed to include meaningful, hands-on projects inspired by student interests \u2014 from building bridges to launching rockets, coding apps to researching science topics in depth. These teach more than content. They build initiative, creativity, and perseverance.","Projects and Enrichment"),A.f5("This place is being built for children who think differently. That means academic challenge, yes \u2014 but also emotional support and a peer group that makes sense.\n\nKids here will be encouraged to ask hard questions, think out loud, and feel understood. They\u2019re not weird for wanting more. They belong.","Support for Gifted Learners"),A.f5("When operations begin, every student will complete subject-by-subject placement testing. To qualify for a level, they must score at least 85% in that year\u2019s curriculum. If tested after September, we\u2019ll use the *next* academic year.\n\nTesting continues until the student no longer meets the threshold. Placement is set there \u2014 and it\u2019s done independently for each subject. So a child strong in Maths but still catching up in English can be placed accurately in both.","Placement Testing"),A.f5("Students will be able to re-test and move up at any time \u2014 no arbitrary waiting. Once they meet the benchmark, they advance immediately. Expectations will be clear, and both parents and students can track progress transparently.","Progression")],A.ab("x<jQ>")))
s($,"ayK","aku",()=>A.c([A.f5("Kuching Selective was created in response to a clear gap: there are few local options built specifically for children who learn quickly and think differently. Grade-skipping often feels too blunt, and traditional tuition too narrow. We wanted a space that could meet gifted learners where they are \u2014 both academically and emotionally.\n\nPlanning is currently underway, with a proposed location near Saradise, Kuching. We are inviting expressions of interest while preparing curriculum materials, teaching frameworks, and digital resources in advance of formal operations.","How It Started"),A.f5("Kuching Selective was founded by Juliana Wong \u2014 a parent and experienced operations manager \u2014 who saw firsthand how hard it was to find the right support for gifted learners.\n\nJuliana is the Founder and Operations Lead. With a background in administration and staff coordination, she has trained and managed teams across fast-paced business environments. She brings strong organisational skills, people management, and a calm, practical approach to running the centre. At Kuching Selective, she oversees day-to-day operations, parent engagement, and the overall experience for families.\n\nWilson Luu serves as the centre\u2019s educational lead. A qualified actuary with 15 years in senior roles across Australia, New Zealand, and Hong Kong, his career began in education. Before moving into actuarial work, he taught gifted students at Hurlstone Agricultural High School \u2014 one of Sydney\u2019s top selective schools \u2014 where he provided academic tutorials and extension support. He also founded and ran a tuition centre in Sydney and continues to work closely with advanced learners.\n\nTogether, Juliana and Wilson bring both the professional experience and personal insight of parents navigating the education system for a child who didn\u2019t quite fit inside it.\n\n*Kuching Selective is an educational initiative operated by Polarian PLT (LLP0042554-LGN), a registered Malaysian partnership based in Kuching, Sarawak.*","Who We Are")],A.ab("x<jQ>")))
